import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import PersonIcon from '@material-ui/icons/Person';
import { deepPurple } from '@material-ui/core/colors';
import Avatar from '@material-ui/core/Avatar';
import UploadButton from './uploadbutton';
import ResultTable from './resulttable';
import KPMGlogo from '../../static/KPMG_logo_white.svg';

const useStyles = makeStyles((theme) => ({
    box: {
        padding: theme.spacing(1),
        textAlign: 'center',
        color: theme.palette.text.secondary,
        whiteSpace: 'nowrap',
        margin: theme.spacing(2),
    },
    divider: {
        margin: theme.spacing(2, 0),
    },
    icon: {
        position: 'relative',
        top: '35%',
    },
    avatar: {
        backgroundColor: deepPurple[200],
        color: deepPurple[500],
      },
}));



export default function Main() {
    const classes = useStyles();

    return (
        <Container fixed>
            <Grid container>
                <Grid item xs={3} direction="column" justify="center" alignItems="stretch" >
                    <Box bgcolor="primary.light" className={classes.box} height={200}>
                        <img src={KPMGlogo} alt="KPMG_logo" style={{width:'40%', float:'left'}} />
                        <div>
                        <Avatar className={classes.avatar}>
                <PersonIcon />
              </Avatar>
                        </div>
                    </Box>
                    <Box bgcolor="primary.light" color='text.primary' className={classes.box} height={100}>
                        <UploadButton />
                    </Box>
                    <Box bgcolor="primary.light" className={classes.box} height={535}>file list</Box>
                </Grid>
                <Grid item xs={9} direction="column" justify="center" alignItems="stretch" >
                    <Box bgcolor="primary.light" className={classes.box} height={900}>
                        <ResultTable />
                    </Box>
                </Grid>
            </Grid>
        </Container>
    );
}
